class GameOverWin extends Component{
    render(){
        let prevWinner= this.props.player==="X"?"O":"X"
    return(
      <React.Fragment>
        <div>
            <h2>{prevWinner} You win</h2>
        </div>
      </React.Fragment>
    )
  }
}
export default GameOverWin
